import Navbar from './navbar/Navbar';
import "./index.css";
import Header from './header/Header';
import About from './about/About';
import Services from './services/Services';
import Slider from './slider/Slider';

function App() {
  return (
  <>
   <Navbar/>
   <Header/>
   <About/>
   <Services/>
   <Slider/>
  </>
  );
}

export default App;
